The Elder Scrolls V: Skyrim CoronerLemurEdition v.1.3.2
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
Version: 1.9.32.0.8 and USKP.
Type: Game with mod Compilation.
Language: only Russian.
Gameplay based on Perkus Maximus 1.2.
Interface and graphics based on SLMP-JG project.
Falskaar, Wyrmstooth, MoonpathToElsweyr, ..., ImmersiveCreatures, HighLevelEnemies, ..., BetterVampires, MoonlightTale, ..., FrostFall, Hunterborn, Realistic Needs &amp; Diseases and many others.

Site of mod compilation: http://rubarius.ru/viewforum.php?f=19

Game Notes:
~~~~~~~~~~~
The next chapter in the highly anticipated Elder Scrolls saga arrives from
the makers of the 2006 and 2008 Games of the Year, Bethesda Game Studios.
Skyrim reimagines and revolutionizes the open-world fantasy epic, bringing
to life a complete virtual world open for you to explore any way you choose.

Install Notes:
~~~~~~~~~~~~~~
Install, configure and play!

Credits:
~~~~~~~~
